import React from "react";
import Nav from "../components/Nav";
import waves from "../assets/images/wave7.png";
import "./studentHome.css";
import tick from "../assets/images/tick.png";
import bar from "../assets/images/bar.png";

const StudentHome=()=>{
    return(
        <div id="studentHome">
            <div>
                <img src={waves} alt="waves"/>
            </div>
            <div className="timeline">
                <h5>Here is your timeline.</h5>
                <div id="outer3">
                    <div><div className="tick"><img className="tickImg" src={tick} /></div><div><strong>Background Check</strong></div></div>
                    <div><div className="bar"><img className="barImg" src={bar} /></div><div></div></div>
                    <div><div className="tick"><img className="tickImg" src={tick} /></div><div><strong>Choose country, school and program</strong></div></div>
                    <div><div className="bar"><img className="barImg" src={bar} /></div><div></div></div>
                    <div><div className="tick"><img className="tickImg" src={tick} /></div><div><strong>Get connected with an edu</strong></div></div>
                    <div><div className="bar"><img className="barImg" src={bar} /></div><div></div></div>
                    <div><div className="tick"><img className="tickImg" src={tick} /></div><div><strong>Meet your future classmates</strong></div></div>





                    <div></div>
                </div>
            </div>

            <Nav pageName="home" />
        </div>
    )
}

export default StudentHome;
